import { ReactDOM } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Register from "./components/Register/Register";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/index" element={<Register />}>
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
